import React from "react";
import Footer from "../components/Footer";
import NavigationBar from "../components/NavigationBar";
import Resume from "../components/Resume/Resume";

const ResumePage = () => {
  return (
    <>
      <NavigationBar />
      <Resume />
      <Footer />
    </>
  );
};

export default ResumePage;
